import CardList from './CardList';
import {nbaPlayers} from './nbaPlayers';
import SearchBox from './SearchBox';



class App extends Components {

   constructor(){
      Super();
      this.state = {
         nbaPlayers: {nbaPlayers}

      }
   }

   render(){
      return (
         <div className = 'tc'>
            <h1>NBA Dash Board</h1>
            <SearchBox/>
            <CardList nbaPlayers = {this.nbaPlayers}/>
         </div>
      )
   };

}

export default App;
